const columnHelper = createColumnHelper<Person>();
const statusColor = {
  requested: "orange",
  taken: "var(--primary-green)",
  canceled: "red",
};

const columns = [
  columnHelper.accessor("id", {
    header: "No",
    cell: (info) => info.row.index + 1,
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor("id", {
    cell: (info) => info.getValue(),
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor((row) => row.created_at, {
    id: "created_at",
    cell: (info) => <i>{dayjs(info.getValue()).format("DD MMMM YYYY")}</i>,
    header: () => <span>Date</span>,
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor("donor.name", {
    header: () => "Donor",
    cell: (info) => info.renderValue(),
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor("donee.name", {
    header: () => "Donee",
    cell: (info) => info.renderValue(),
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor("product.address_id", {
    header: () => <span>Location_ID</span>,
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor("amount", {
    header: () => <span>Amount</span>,
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor((row) => row.status, {
    id: "status",
    cell: (info) => (
      <div style={{ display: "flex", alignItems: "center", gap: 5 }}>
        <div
          style={{
            borderRadius: "100%",
            height: 8,
            width: 8,
            backgroundColor:
              statusColor?.[
                info.getValue() as "requested" | "canceled" | "taken"
              ],
          }}
        />
        <i>{info.getValue()}</i>
      </div>
    ),
    header: () => <span>Status</span>,
    footer: (info) => info.column.id,
  }),
  columnHelper.accessor((row) => row.id, {
    id: "id",
    cell: (info) => (
      <Dropdown
        trigger="hover"
        overlay={[
          { render: <div style={{ color: "orange" }}>Edit</div> },
          {
            render: <div style={{ color: "red" }}>Hapus</div>,
          },
        ]}
      >
        <div
          style={{
            display: "flex",
            alignItems: "center",
            gap: 2,
            cursor: "pointer",
            padding: 10,
          }}
        >
          <div
            style={{
              borderRadius: "100%",
              height: 5,
              width: 5,
              backgroundColor: "black",
            }}
          />
          <div
            style={{
              borderRadius: "100%",
              height: 5,
              width: 5,
              backgroundColor: "black",
            }}
          />
          <div
            style={{
              borderRadius: "100%",
              height: 5,
              width: 5,
              backgroundColor: "black",
            }}
          />
        </div>
      </Dropdown>
    ),
    header: () => <span>Action</span>,
    footer: (info) => info.column.id,
  }),
];

export default function DonasiList() {
  const [data, setData] = useState(() => [...defaultData]);

  const qDonasiHistory = useQuery({
    queryFn: getUserDonation,
    queryKey: ["/user/donation"],
  });

  useEffect(() => {
    if (qDonasiHistory.data?.data) {
      setData(qDonasiHistory.data?.data);
    }
  }, [qDonasiHistory?.data?.data]);

  const table = useReactTable({
    data,
    columns,
    getCoreRowModel: getCoreRowModel(),
  });

  return (
    <div className={styles.container}>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <h3>Donasi List</h3>

        <div>
          <select>
            <option>Monthly</option>
          </select>
        </div>
      </div>
      <div className="table-wrapper">
        <table>
          <thead>
            {table.getHeaderGroups().map((headerGroup) => (
              <tr key={headerGroup.id}>
                {headerGroup.headers.map((header) => (
                  <th key={header.id}>
                    {header.isPlaceholder
                      ? null
                      : flexRender(
                          header.column.columnDef.header,
                          header.getContext()
                        )}
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody>
            {table.getRowModel().rows.map((row) => (
              <tr key={row.id}>
                {row.getVisibleCells().map((cell) => (
                  <td key={cell.id}>
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
          {/* <tfoot>
            {table.getFooterGroups().map((footerGroup) => (
              <tr key={footerGroup.id}>
                {footerGroup.headers.map((header) => (
                  <th key={header.id}>
                    {header.isPlaceholder
                      ? null
                      : flexRender(
                          header.column.columnDef.footer,
                          header.getContext()
                        )}
                  </th>
                ))}
              </tr>
            ))}
          </tfoot> */}
        </table>
      </div>
    </div>
  );
}
